import "../Css-files/home.css"

import React, { useEffect, useState } from 'react';

export default function Home() {


  class MyComponent extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        items: []
      };
    }

    componentDidMount() {
      fetch("https://jsonplaceholder.typicode.com/users/")
        .then(res => res.json())
        .then(
          (result) => {
            this.setState({
              isLoaded: true,
              items: result.items
            });
          },
          // Note: it's important to handle errors here
          // instead of a catch() block so that we don't swallow
          // exceptions from actual bugs in components.
          (error) => {
            this.setState({
              isLoaded: true,
              error
            });
          }
        )
    }

    render() {
      const { error, isLoaded, items } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        return (
          <ul>
            {items.map(item => (
              <li key={item.id}>
                {item.name} {item.price}
              </li>
            ))}
          </ul>
        );
      }
    }
  }










  return (
<div>  

  <h1 className="title"> Looking for a specific food or destination? Let <span className="logo">TravelEat </span> help! </h1>

  <div className="container"> 
      <div>    
        <input className="searchContainer" type="text" placeholder="Food or Destination"></input>
      </div>
  </div>
        <button className="searchButton" type="button" onClick={componentDidMount()}>Search</button>
        <div id="result" className="returnedResult" ></div>
</div> 
  );
  }
